nk.\"},\n        Do(function()\n            self.scene.player.noIdle = true\n            self.scene.player.sprite:setAnimation(\"thinking\")\n        end),\n        MessageBox{message=\"Sally: I was also a little concerned about Logan--\", closeAction=Wait(1)},\n        Animate(self.sprite, \"shock\"),\n        self:hop(),\n        MessageBox{message=\"Fleet: Logan!?\"},\n        MessageBox{message=\"Fleet: What's wrong!? {p60}Did something happen to her?!\"},\n        MessageBox{message=\"Sally: She's fine. {p60}It's just that she doesn't seem to spend much time outside the workshop really...\"},\n        Animate(self.sprite, \"frustrated\"),\n        MessageBox{message=\"Fleet: O-Oh. {p60}*ahem*{p60} Of course.\"},\n        Animate(self.sprite, \"smirk\"),\n        Do(function()\n            self.scene.player.sprite:setAnimation(\"idleup\")\n        end),\n        MessageBox{message=\"Fleet: Logan is not the most social person. {p60}She often gets caught up in her work and likes to stay close to it. {p60}Maybe you Freedom Fighters could learn a thing or two from her!\"},\n        Wait(1),\n        Animate(self.sprite, \"lookright\"),\n        MessageBox{message=\"Fleet: She really only talks to Leon, Ivan, and I...\"},\n        Animate(self.scene.objectLookup.Ivan.sprite, \"attitude\"),\n        MessageBox{message=\"Ivan: Understandable given that she lost her family...\"},\n        MessageBox{message=\"Fleet: Yeah well... {p60}she may be a pain{p60}, but she's our little pain...\"},\n        Animate(self.scene.objectLookup.Ivan.sprite, \"idledown\"),\n        MessageBox{message=\"Sally: That's so sweet.\"},\n        Animate(self.sprite, \"shock\"),\n        self:hop(),\n        MessageBox{message=\"Fleet: Sweet?!\"},\n        Animate(self.sprite, \"smirk\"),\n        MessageBox{message=\"Fleet: Get outta here! It's just common decency is all!\"},\n        MessageBox{message=\"Fleet: Now if you'll excuse us, we'd like to get situated so I suggest you buzz off Acorn!\"},\n        Animate(self.sprite, \"idleleft\"),\n        MessageBox{message=\"Fleet: Time to grab my top bunk!\"},\n        Animate(self.scene.objectLookup.Ivan.sprite, \"attitude\"),\n        MessageBox{message=\"Ivan: Incorrect.\"},\n        Animate(self.sprite, \"shock\"),\n        self:hop(),\n        Wait(1),\n        Animate(self.sprite, \"frustrated\"),\n        MessageBox{message=\"Fleet: Just let us be...\"},\n        Do(function() self.scene.player.noIdle = true end)\n    }\nend",
